import React, { useState } from "react";
import { Link } from "react-router-dom";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faCoffee, faTimes, faBars } from "@fortawesome/free-solid-svg-icons";
import { Button } from "./Button";

function Navbar() {
  const [click, setClick] = useState(false);
  const [button, setButton] = useState(true);

  const handleClick = () => setClick(!click);
  const closeMobileMenu = () => setClick(false);

  return (
    <>
      <nav className="navbar">
        <div className="navbar-container">
          <Link to="/" className="navbar-logo">
            MassDebator <FontAwesomeIcon icon={faCoffee} />
          </Link>

          <div className="menu-icon" onClick={handleClick}>
            <FontAwesomeIcon icon={click ? faTimes : faBars} />
          </div>
          <ul className={click ? "nav-menu active" : "nav-menu"}>
            <li className="nav-item">
              <Link to="/" className="nav-links" onClick={closeMobileMenu}>
                Home
              </Link>
            </li>
            <li className="nav-item">
              <Link to="/debates" className="nav-links" onClick={closeMobileMenu}>
                Debates
              </Link>
            </li>
            <li className="nav-item">
              <Link to="/profile" className="nav-links" onClick={closeMobileMenu}>
                Profile
              </Link>
            </li>
          </ul>
          {button && <Button buttonStyle="btn--outline">PROFILE</Button>}
        </div>
      </nav>
    </>
  );
}

export default Navbar;
